import React, { Component } from "react";
import Header from "../../../component/header";
import { findUnitsById } from "../../../action/units";
import UnitPageList from '../UnitPageList';
export class UnitPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      data: []
    };
  }

  componentDidMount() {
    this.setState({ data: findUnitsById(match.params.id) });
  }
  render() {
    const { data } = this.props;
    return (
      <div>
        <Header>this is unit page with id: {JSON.stringify(data, 0 ,2)}</Header>
      </div>
    );
  }
}

export default UnitPage;
